    end
    C=[C,linshi_a(:,v+1)<=linshi_e,linshi_b(:,v+1)<=tan(pi/2^(v+1))*linshi_a(:,v+1),linshi_c(:,v+1)<=(u(:,1)+u(:,2))/2,linshi_d(:,v+1)<=tan(pi/2^(v+1))*linshi_c(:,v+1)];
